import './App.css';
import React from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import Navbar from './components/Navbar'
import Home from "./components/pages/Home";

function App() {
  return (
    <>
      <Router>
        <Navbar></Navbar>

        <Switch>
          <Route path="/" exact component={Home} />
        </Switch>
      </Router>
    </>

  );
}

export default App;
